import React from 'react';
import Head from 'next/head';
import Header from '../components/header';

const Signup = () => {
	return (
		<>
			<Head>
				<title> 회원가입 | NodeBird </title>
			</Head>
			<Header>회원가입 페이지</Header>
		</>
	)
};

export default Signup;
